import React, { useState } from 'react';
import './index.css'; // Assuming you have a CSS file for styling

const HomePage = () => {
    const [team1, setTeam1] = useState('');
    const [team2, setTeam2] = useState('');

    const selectTeam = (teamimg, teamName) => {
        if (!team1) {
            setTeam1({ img: teamimg, name: teamName });
        } else if (!team2 && teamimg !== team1.img) {
            setTeam2({ img: teamimg, name: teamName });
        } else {
            alert('Please select a different team for prediction.');
        }
    };

    const clearSelections = () => {
        setTeam1('');
        setTeam2('');
    };

    return (
        <div>
            <nav className="navbar navbar-expand-lg bg-body-tertiary">
                <div className="container-fluid navbar-color">
                    <a className="navbar-brand" href="#">
                        <img src="5492.jpg" className="navbar-image" alt="Cricket Logo" />
                    </a>
                    <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
                        <span className="navbar-toggler-icon"></span>
                    </button>
                    <div className="collapse navbar-collapse" id="navbarNav">
                        <ul className="navbar-nav ms-auto">
                            <li className="nav-item">
                                <a className="nav-link active" aria-current="page" href="#" style={{ fontWeight: 'bold' }}>Home</a>
                            </li>
                            <li className="nav-item">
                                <a className="nav-link" href="#" style={{ fontWeight: 'bold' }}>TEAMS</a>
                            </li>
                            <li className="nav-item">
                                <a className="nav-link" href="07venue.html" style={{ fontWeight: 'bold' }}>VENUE</a>
                            </li>
                            <li className="nav-item">
                                <a className="nav-link" href="#about-us" style={{ fontWeight: 'bold' }}>ABOUT US</a>
                            </li>
                            <li className="nav-item">
                                <Link to="/loginpage" className="nav-link">Login</Link>

                            </li>
                        </ul>
                    </div>
                </div>
            </nav>

            <div className="scrolling-text marquee-background-color">
                <marquee behavior="scroll" direction="left" scrollamount="10">
                    Welcome to IPL Prediction: Your Ultimate Destination for Cricket Enthusiasts! So, get your game face on! where fans become champions and your predictions could lead you to victory. Join us today and let’s make this IPL season unforgettable!
                </marquee>
            </div>

            <div className="container team-container">
                <h2 className="text-center mb-4">Select Two IPL Teams</h2>
                <div className="row">
                    {['csk', 'mi', 'rcb', 'kkr', 'srh', 'rr', 'dc', 'gt', 'lsg', 'pk'].map((team, index) => (
                        <div className="col-md-4" key={index}>
                            <div className={`team ${team}`} onClick={() => selectTeam(`${team}.jpg`, team.replace(/([A-Z])/g, ' $1'))}>
                                <div className="team-name textStyle">{team.replace(/([A-Z])/g, ' $1')}</div>
                            </div>
                        </div>
                    ))}
                </div>
            </div>

            <div className="container text-center mt-4">
                <h4>Selected Teams:</h4>
                <div id="selectedTeams" className="d-flex justify-content-center align-items-center">
                    {team1 && (
                        <div id="team1" className="selected-team" style={{ backgroundImage: `url(${team1.img})` }}>
                            <div className="team-name">{team1.name}</div>
                        </div>
                    )}
                    <div className="vs">VS</div>
                    {team2 && (
                        <div id="team2" className="selected-team" style={{ backgroundImage: `url(${team2.img})` }}>
                            <div className="team-name">{team2.name}</div>
                        </div>
                    )}
                </div>
                <button id="clearButton" className="btn btn-secondary mt-4" onClick={clearSelections} disabled={!team1 && !team2}>Clear</button>
            </div>
        </div>
    );
};

export default HomePage;
